import { render } from '@testing-library/react';
import React, {Component} from 'react';
import Category  from './Category';

class CategoryInDb extends Component{

    constructor(){
        super();

        this.state = {

            categorias : [],
        }
    }
 componentDisMount(){

    fetch('/api/products/categorias')
    .then(respuesta=>{
         return respuesta.json()
    })
    .then(categorias =>{

        this.setState({categorias: categorias.indice})
        console.log(categorias)
    })
    .catch(error => console.log(error))
}
   render(){
return (

         
        <React.Fragment>
           
           
            {/*<!-- Categories in DB -->*/}
					
<div className="card card-category">
    
    <h3 className="h3 ">Categorias en la Base de Datos</h3>
    <hr className= "linea-big"/>

<div className="card-body">
    <div className="row-categories">
        {this.state.categorias.map((categoria, index)=>{
            return < Category {...categoria} key={index} />

            
        })}
       
    </div>
    </div>

    </div>


    </React.Fragment>
    )}

}
export default CategoryInDb;
